      function displayFormula(id,bold) {

        var systemIndex;
        var problemIndex;
        var solvers;
        var solvedBySystem;

        solvers = id;
        for (systemIndex=0;systemIndex<systems.length;systemIndex++) {
          if (bold == 0) {
            document.getElementById(systems[systemIndex]).
setAttribute("fill-opacity","1.0");
            solvers = "Theorem name (mouse over nodes)";
          } else {
            solvedBySystem = 0;
            for (problemIndex in nodes[systemIndex]) {
              if (nodes[systemIndex][problemIndex] == id) {
                if (systems[systemIndex] != "Solved") {
                  if (solvers == id) {
                    solvers += " (";
                  } else {
                    solvers += ",";
                  }
                  solvers += systems[systemIndex];
                }
                solvedBySystem = 1;
                break;
              }
            }
            if (solvedBySystem == 0) {
              document.getElementById(systems[systemIndex]).
setAttribute("fill-opacity","0.0");
            }
          }
        }
      solvers += ")";
      document.getElementById("name").firstChild.nodeValue = solvers;
      }



      var colors = new Array('white','white','white','white','white','white',
