      function highlight(nodesindex,fromColor,toColor,permanent) {

        var index;
        var currentColor;

        if (permanent == 1) {
          if (colors[nodesindex] != 'white') {
            colors[nodesindex] = 'white';
          } else {
            colors[nodesindex] = toColor;
          }
          toColor = colors[nodesindex];
        } else {
          if (colors[nodesindex] != 'white') {
            toColor = colors[nodesindex];
          }
        }
        if (fromColor != toColor) {
          for (index in nodes[nodesindex]) {
            if (document.getElementById(nodes[nodesindex][index]).
getAttribute("fill") == fromColor) {
              document.getElementById(nodes[nodesindex][index]).
setAttribute("fill",toColor);
            }
          }
        }
      }
